!function(){const e=document.querySelector(".submit-quote-form"),t=apiVars.url+"wp/v2/posts";e.addEventListener("submit",e=>{e.preventDefault();const o={title:e.target[0].value,content:e.target[1].value,_qod_quote_source:e.target[2].value,_qod_quote_source_url:e.target[3].value,status:"publish"};fetch(t,{method:"POST",credentials:"include",headers:{"content-type":"application/json","X-Wp-Nonce":apiVars.nonce},body:JSON.stringify(o)}).then(e=>console.log(e)).catch(e=>console.log(e))})}();